FeedPackage.ReleaseNotes:
New - LINQ: Improved processing of Include/LoadWith hints when the used IQueryable<T> is not a Telerik Data Access type - IQueryable<T> extension methods Include() and LoadWith() now are less strict in checking the target IQueryable and can accept non-Data Access types implementing IQueryable<T> - LINQ: Support for joins based on non-column expressions on the left side - Example: from o in context.Orders join od in context.OrderDetails on new {K1 = o.OrderId, K2 = customerIdParam } equals new { K1 = od.OrderId, K2 = od.CustomerId }
Fixed - Runtime: GetOriginalValues() causing unexpected concurrency issues for reference navigation properties when Changed Concurrency Control is used - Runtime: UpdateAll batch operation can throw exception when source query does not involve parameters - The IQueryable<T> extension method UpdateAll() is not throwing exception any more in the cases where the underlying LINQ query is not using parameters.
NOTE: These Release Notes include only the runtime changes in the particular Telerik Data Access release. For the full list of changes please refer to the Telerik web site ( http://www.telerik.com/support/whats-new/data-access/release-history ).

FeedPackage.Description:
D.C3: Distributed .NET Cloud-based Configuration Client. Use D.C3 to access an Azure Storage-based application configuration repository. Also accesses App.Config or Web.Config-based configuration objects for the Dev environment.
Sample code: var configObject = (new AppConfigurationProvider()).Get[Types.SampleConfiguration]();
Learn more at techinceptions.com/DC3

